import React from "react";
import { Link, useNavigate } from "react-router-dom";
import './Home.css'; // For custom styling

function Home() {
    const navigate = useNavigate();

    const handleLogout = () => {
        navigate("/"); // Redirect to login page
    };

    return (
        <div className="home-container">
            {/* Navigation Bar */}
            <nav className="navbar">
                <h2 className="navbar-title">Welcome to IdeaHub</h2>
                <div className="navbar-links">
                    <Link to="/dashboard" className="nav-link">Dashboard</Link>
                    <Link to="/submit-idea" className="nav-link">Submit Ideas</Link>
                    <Link to="/view-ideas" className="nav-link">View Ideas</Link>
                    <Link to="/profile" className="nav-link">My Profile</Link>
                    <Link to="/rewards" className="nav-link">My Rewards</Link>
                    <button className="nav-link logout-btn" onClick={handleLogout}>
                        Logout
                    </button>
                </div>
            </nav>

            {/* Main Content */}
            <div className="main-content">
                <h1>Welcome to the Home Page</h1>
                <p className="welcome-text">
                    Explore your dashboard, submit your creative ideas, view others' suggestions, and manage your profile and rewards.
                </p>
            </div>
        </div>
    );
}

export default Home;
